sources.sass/mobile.scss:
$primarycolor: #36BDCB;
  $secondarycolor: #D9F7FA;
  $thirdcolor:  #F6D6FC;
  $fourthcolor: #FFD9C9;
  $fifthcolor: #FFFFC4;
  $footercolor: #677577;
nav {
    background-color: greenyellow;
    position:fixed;
    bottom:15px;
    left:15px;
    width: 30px;
    height: 30px;
    overflow:hidden;
    transition:height 0.5s, width 0.5s, left 0.5s, bottom 0.5s;
    ul.lis {
        .burger__li {
            opacity: 0;
        }
    }

    }

 nav.is-open {
     background-color:brown;
     position:fixed;
     bottom: 0;
     left:0;
     z-index: 1;
     width: 100%;
     height: 100%;
     opacity: 0.5;
     ul.lis{
         position:fixed;
         display:flex;
         flex-direction:column;
         justify-content:center;
         align-items:center;
         height: 100vh;
         width: 100vw;
         margin-bottom:20%;

       .burger__li {

           opacity:1;
         font-size: 40px;
         margin: -100px;

       }
       .burger__li:not(:last-child) {
         margin-bottom:0;
 }
     }
 }
 .banner {
    background-color: $primarycolor;
    width: 100vw;
    height: 50vh;
    position:absolute;
  .slogan {
    text-align:center;
    top: 30vh;
  }
  }
  .sentence {
    text-align: center;
    position: relative;
    top: 36vh;
    flex-flow: column wrap;
    color: white;
    .jackets {
        display: flex;
        flex-direction: row;
        justify-content: center;
        align-items: center;
        position: absolute;
        overflow: hidden;
        top: -4%;
        right: -64vw;
        width: auto;
        height: 100vh;
        .left__jacket {
            position: relative;
            width: auto;
            height: 43vh;
            transform: rotate(-25.79deg);
            top: -22px;
            left: 0px;
        }
        .right__jacket {
            position: relative;
            width: auto;
            bottom: 55vh;
            right: -2px;
            height: 45vh;
            transform: rotate(36deg);
        }
  }
}
 //  Choisir le modèle
.choose{
    // background-color: $thirdcolor;
    color: $primarycolor;
    text-align: center;
    margin-top: 52vh;
    padding-top:16px;
    padding-bottom: 15px;
      font-size: 24px;
      font-family: "Baloo";
      .button__choose{
        background-color: $primarycolor;
        border: none;
        color: #FFFFFF;
        height: 6vh;
        width: 48vw;
        font-size: 14px;
        border-radius: 20.5px;
        margin-top: 10px;
        margin-bottom: 10px;
        display: block;
        margin: auto;
        text-align: center;
        margin-bottom: 16px;
        box-shadow: 4px 4px 0px $thirdcolor;
      }
      .choose__sections{
        font-size: 18px;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        margin-top: 24px;
      }
      .blue__jacket, .dark__jacket{
        height: 46vh;
        width: auto;
        padding-top: 16px;
      }
      .choose__price{
        color: black;
        font-size: 18px;
      }

      //Desktop
      @media (min-width:750px) {
        font-family: "Montserrat";
        .choose__title{
          font-size: 48px;
          font-family: "Baloo";
        }
        .choose__sections{
          display: flex;
          flex-direction: row;
          justify-content: space-evenly;
        }
        .button__choose{
          width: 36vw;
          height: 7.5vh;
          text-align: center;
          font-size: 24px;
        }
        // .choose__blue{
        //   padding-right: 160px;
        // }
        .choose__price{
          font-size: 18px;
        }
      }
   }

   // Fans 
   .fans{
    // background-color: $secondarycolor;
    height: 56vh;
    color: $primarycolor;
    text-align: center;
    padding-top: 16px;
    font-size: 24px;
    // margin-bottom: 16px;
    .fans__title{
      font-family: "Baloo";
    }
    .fans__img{
      display: grid;
      grid-template-columns: 1fr 1fr;
      grid-gap: 15px;
      grid-template-rows: 1fr 1fr;
      padding-top: 32px;
    }
    .button__fans{
      background-color: $primarycolor;
        border: none;
        color: #FFFFFF;
        height: 5vh;
        width: 48vw;
        font-size: 10px;
        border-radius: 20.5px;
        margin-top: 50px;
        display: block;
        margin: auto;
        box-shadow: 4px 4px 0px $thirdcolor;
    }

    @media (min-width:750px) {
      background-color: white;
      font-size: 48px;
      padding-top: 24px;
      height: 72vh;
      .button__fans{
        height: 8.38vh;
        width: 32vw;
        font-size: 24px;
        border-radius: 20.5px;
        margin-top: 24px;
        margin-bottom: 24px;
      }
      .fans__img{
        display: grid;
        grid-template-columns: 1fr 1fr;
        grid-gap: 15px;
        grid-template-rows: 1fr 1fr;
      }
      }   

   }

   .star1{
    height: 17.85vh;
    width: auto;
    grid-column: 1 / 2;
    grid-row: 1 / 2;
    align-self: center;
    justify-self: center;
   }

   .star2{
    height: 17.85vh;
    width: auto;
    grid-column: 2 / 2;
    grid-row: minmax (100px, auto);
    align-self: center;
    justify-self: center;
   }

   .star3{
    height: 17.85vh;
    width: auto;
    grid-column: 1 / 2;
    grid-row: 2 / 2;
    align-self: center;
    justify-self: center;
   }

   .star4{
    height: 17.85vh;
    width: auto;
    grid-column: 2 / 2;
    grid-row: 2 / 2;
    align-self: center;
    justify-self: center;
   }

